import React from "react";

export default function Drawer(props) {
    return (
        <div className="drawer">
	<h2 className="drawer-title">props.title</h2>
            {(props.children).map(child => {
	        <a href = {child.props.href}>
	            <div className="drawer-button">
		        {child}
		    </div>
	        </a>
	    })}
	</div>
    );
}
